from typing import List
from unittest import TestCase

class Solution:
  def shortestDistance(self, maze: List[List[int]], start: List[int], destination: List[int]) -> int:
    
    mazeEnum = {
      "EMPTY": 0,
      "WALL": 1,
    }

    m, n = len(maze), len(maze[0])
    directions = [
      (-1, 0), # up
      (1, 0), # down
      (0, -1), # left
      (0, 1), # right
    ]
    queue = [(start, 0)]
    seen = dict()
    seen[(start[0], start[1])] = 0

    while queue:
      (pos, distance) = queue.pop(0)
      # if pos == destination:
      #   return distance
      for (r, c) in directions:
        row, col = pos[0], pos[1]
        distanceTraveled = distance
        while 0 <= (row + r) < m and 0 <= (col + c) < n and maze[(row+r)][(col+c)] == mazeEnum["EMPTY"]:
          row+=r
          col+=c
          distanceTraveled+=1

        if (row, col) in seen and distanceTraveled < seen[(row, col)]:
          seen[(row,col)] = distanceTraveled
          queue.append(([row, col], seen[(row, col)]))
        elif (row, col) not in seen:
          seen[(row,col)] = distanceTraveled
          queue.append(([row, col], seen[(row, col)]))

    if (destination[0], destination[1]) in seen:
      return seen[(destination[0], destination[1])]
    else:
      return -1
  
solution = Solution()
testCase = TestCase()

